import { css } from 'emotion';
import Vote from './Vote';

const Card = (props) => (
  <div>
    <div>
      {props.index}
      <Vote />
      <span>{props.title}</span>
    </div>
    <span>
      {props.points} points | Sponsor Name: {props.sponsor_name} {props.latest_major_action_date} | <span>hide</span> | {props.comments.length} comments
    </span>
  </div>
);

export default Card;
